import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';
import Followers from './Followers';
import Winner from './'

ReactDOM.render(
  <React.StrictMode>
    <Winner/>
  </React.StrictMode>,
  document.getElementById('root')
);

